import React from 'react';
import { View, Text, StyleSheet, ScrollView } from "react-native";
import { Header } from "@rneui/base";
import { Icon, Avatar } from 'react-native-elements';

export default function ListaTell({ navigation }) {
    const goToLogin = () => {
        navigation.navigate('Login');
    };

    const list = [
        {
            name: 'Amy Farha',
            avatar_url: 'https://geekblog.com.br/wp-content/uploads/2020/12/Desktop-Wallpaper-Stormtrooper-Of-Star-Wars-Movie-Hd-Image-Picture-Background-8rgwwh.jpg.webp',
        },
        {
            name: 'Chris Jackson',
            avatar_url: 'https://geekblog.com.br/wp-content/uploads/2020/12/Desktop-Wallpaper-Stormtrooper-Of-Star-Wars-Movie-Hd-Image-Picture-Background-8rgwwh.jpg.webp',
        },
    ];

    return (
        <>
      <Header
        backgroundImageStyle={{}}
        barStyle="default"
        centerComponent={{
          text: "Lista de contatos",
          style: { color: "#fff", fontWeight: "bold" }
        }}
        centerContainerStyle={{}}
        leftContainerStyle={{}}
        linearGradientProps={{}}
        placement="center"
        rightComponent={
          <TouchableOpacity onPress={() => navigation.navigate('NovoContato')} >
            <Icon name="add" color="#fff" />
          </TouchableOpacity>
        }
        rightContainerStyle={{}}
        statusBarProps={{}}
        containerStyle={{ backgroundColor: "#1670f7" }}
      />

            <ScrollView>
                <View style={styles.container}>
                    {
                        list.map((l, i) => (
                            <View key={i} style={styles.listItem}>
                                <Avatar
                                    size="medium"
                                    rounded
                                    source={{
                                        uri: l.avatar_url,
                                    }}
                                />
                                <Text style={styles.name}>{l.name}</Text>
                            </View>
                        ))
                    }
                </View>
            </ScrollView>
        </>
    );
}

const styles = StyleSheet.create({
    container: {
        flexDirection: 'column',
    },
    listItem: {
        display: 'flex',
        flexDirection: 'row',
        gap: '5%',
    },
    name: {
        marginTop: 8,
        textAlign: 'center',
        fontSize: 18,
        fontWeight: 'bold',
    },
});
